import React from "react";
import { ComposableMap, Geographies, Geography } from "react-simple-maps";

const geoUrl =
  "https://raw.githubusercontent.com/datasets/geo-boundaries-world-110m/master/countries.geojson"; // Nowy działający URL

const Map = () => {
  return (
    <ComposableMap style={{ width: "100%", height: "auto" }}>
      <Geographies geography={geoUrl}>
        {({ geographies, error }) => {
          if (error) return <p>There was a problem fetching the data.</p>;
          if (!geographies.length) return <p>Loading...</p>;

          return geographies.map((geo) => (
            <Geography key={geo.properties.ADMIN} geography={geo} />
          ));
        }}
      </Geographies>
    </ComposableMap>
  );
};

export default Map;
